import React from "react";
import CartProduct from "./CartProduct";
import classes from "./cart.module.scss";

const CartProductList = (props) =>{
    
    return(
        <>
            {props.products && props.products.map((product)  => (
                    <CartProduct
                        product={product}
                        key={product.id}
                        {...props}
                    />
            ))
            }
            </>
    )
}

export default CartProductList;
